import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'flow-visualizer-test';
}

<h1>bushra</h1>
<app-horizontal-organization-chart-visualizer></app-horizontal-organization-chart-visualizer>
<app-flow-visualizer></app-flow-visualizer>
<flow-visualizer 
  [Highcharts]="Highcharts"
  [options]="chartOptions"
  style="width: 100%; height: 600px; display: block;">
</flow-visualizer>
